function Practice() {

const[value,setValue]=useState([]);

useEffect(()=>{
    axios.get( `https://jsonplaceholder.typicode.com/posts`)
    .then(res=>{
        const data=res.data
        setValue(data)
    })
},[value]);

const HandleDataFetch=()=>{
    console.log(value)
}
return (
    <div className='Wrapper'>
        <button type='button' onClick={HandleDataFetch}>Click Me</button>
      <div>
      <Table>
                  <thead>
                    <tr>
                      <th>#</th>
                      <th>First Name</th>
                      <th>Last Name</th>
                      <th>Username</th>
                    </tr></thead><tbody>
       {value.map((value,index)=>{return(
                  
                  
                  
                    <tr>
                      <th scope="row">1</th>
                      <td>Mark</td>
                      <td>Otto</td>
                      <td>@mdo</td>
                    </tr>
                    
          
        )
        
       })}
       </tbody>
       </Table>
      </div>
       </div>
  )
}

export default Practice
